import { MainPage } from "./components/Main";
import { Health } from "./components/Health";

const data = [
  {
      title: 'Physical Health',
      color: '#22356F'
  },
  {
      title: 'Mental Health',
      color: '#0052C1'
  },
  {
      title: 'Nutrition',
      color: null
  },
  {
      title: 'Gymnastics',
      color: '#62D0DF'
  },
  {
      title: 'Crossfit',
      color: '##DEE1FF'
  },
  {
      title: 'Aerobics',
      color: '#8F00FF'
  },
]

function App() {
  return (
    <div className="App">
    <MainPage/>

    {
      data.map
    }
    </div>
  );
}

export default App;
